import React from 'react'
import {Link} from 'react-router-dom'

const navLinks = [
    {
        title: 'Home',
        path: '/'
    },
    {
        title: 'WikiBlogPage',
        path: '/wikiblog'
    },
    {
        title: 'Contact-Me',
        path: '/contact-me'
    },
    {
        title: 'Login',
        path: '/login'
    }
]

export default function Nav(){
    return (
        <nav className="navigationbar">
            <span className="menu-title">~WikiBlog~</span>  
            <ul>
                { navLinks.map((link, index)=> (
                    <li key={index}>
                        <Link to={link.path}>{link.title}</Link>
                    </li>
                ))}
            </ul>          
        </nav>
    )
}
